import React from 'react';
import {
  Button,
  Card,
  CardBody,
  CardFooter,
  CardTitle,
  Form,
  FormGroup,
  Input,
} from 'reactstrap';
import { Image, Navbar, Container } from 'react-bootstrap';
import './style.css';
import { Link } from 'react-router-dom';

const ComingSoon = () => {
  return (
      <div>
        <Card className="text-center" style={{width:'60rem', margin:'auto', marginTop:'5%', backgroundColor:'white', borderRadius:'10px'}}>
            <CardBody>
                <Navbar>
                    <Container>
                        <Navbar.Brand href="#home">
                            <Image src="./img/KIPLogo.svg" style={{height:'80px', marginLeft:'30px'}}></Image>
                        </Navbar.Brand>
                        <Nav>
                            <h5>customer.service@kiptour.com</h5>
                        </Nav>
                    </Container>
                </Navbar>
                {/* <div>
                    <Image src="./img/KIPLogo.svg" style={{height:'80px', marginLeft:'30px'}}></Image>
                    <h5>customer.service@kiptour.com</h5>
                </div> */}
            </CardBody>
        </Card>
      </div>
  )
};

export default ComingSoon;
